    public string GetColorForClaimStatus(int id)
    {
        string result = "var(--info)";

        switch (id)
        {
            case 1: result = "var(--info)"; break;
            case 2: result = "var(--warning)"; break;
            case 3:
            case 5:
            case 7:
            case 9:
                result = "var(--success)"; break;
            case 4:
            case 6:
            case 8:
            case 10:
                result = "var(--danger)"; break;
        }

        return result;
    }

